import React from "react";
import MovieList from "../../components/MovieList/MovieList";
import { movies } from "../../data/movies";
import { Gender } from "../../data/genders";
import "./Home.scss";
import { FilterOrder } from "../../data/filter/filterOrder";
import { FilterType } from "../../data/filter/filterType";
import GenderFilter from "../../components/GenderFilter/GenderFilter";

const Home = () => {
  const genders = Object.keys(Gender).map((gender) => {
    return Gender[gender].name;
  });

  const filterOrders = Object.keys(FilterOrder).map((filterOrder) => {
    return FilterOrder[filterOrder].name;
  });

  return (
    <React.Fragment>
      <div className="home" style={{ paddingTop: "4rem" }}>
        <div className="leftPanel">
          <GenderFilter />
          {/* <FilterPanel
            title="Date"
            values={filterOrders}
            filterType={FilterType.Radio}
          /> */}
        </div>
        <div className="list">
          <MovieList movies={movies} />
        </div>
      </div>
    </React.Fragment>
  );
};

export default Home;
